import React, { useState, useEffect } from 'react';
import { getJurisdictions } from '../../services/JurisdictionService/jurisdictionService';
import { calculateTax, saveTransaction } from '../../services/TaxCalculatorService/taxCalculatorService';
import './TaxCalculator.css';

const TaxCalculator = () => {
  const [jurisdictions, setJurisdictions] = useState([]);
  const [formData, setFormData] = useState({
    customer_name: '',
    customer_email: '',
    jurisdiction_id: '',
    items: [{ product_name: '', product_type: 'Digital Software', quantity: 1, unit_price: '' }],
    transaction_date: new Date().toISOString().split('T')[0]
  });
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [successMessage, setSuccessMessage] = useState('');

  useEffect(() => {
    loadJurisdictions();
  }, []);

  const loadJurisdictions = async () => {
    try {
      const data = await getJurisdictions();
      setJurisdictions(data);
    } catch (err) {
      setError('Failed to load jurisdictions');
      console.error(err);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleItemChange = (index, e) => {
    const { name, value } = e.target;
    const updatedItems = [...formData.items];
    updatedItems[index] = { ...updatedItems[index], [name]: value };
    setFormData({ ...formData, items: updatedItems });
  };

  const addItem = () => {
    setFormData({
      ...formData,
      items: [...formData.items, { product_name: '', product_type: 'Digital Software', quantity: 1, unit_price: '' }]
    });
  };

  const removeItem = (index) => {
    if (formData.items.length === 1) {
      return; // Don't remove the last item
    }
    const updatedItems = formData.items.filter((_, i) => i !== index);
    setFormData({ ...formData, items: updatedItems });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccessMessage('');

    try {
      // Validate form data
      if (!formData.customer_name || !formData.jurisdiction_id) {
        throw new Error('Please fill in all required fields');
      }

      for (const item of formData.items) {
        if (!item.product_name || !item.unit_price || item.unit_price <= 0) {
          throw new Error('Please fill in all product details with valid values');
        }
      }

      const result = await calculateTax(formData);
      setResults(result);
    } catch (err) {
      setError(err.message || 'Failed to calculate tax');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleSaveTransaction = async () => {
    if (!results) return;

    try {
      setLoading(true);
      await saveTransaction({
        ...formData,
        subtotal: results.subtotal,
        tax_amount: results.tax_amount,
        total_amount: results.total_amount,
        tax_breakdown: results.tax_breakdown
      });
      setSuccessMessage('Transaction saved successfully!');
      // Reset form after saving
      setFormData({
        customer_name: '',
        customer_email: '',
        jurisdiction_id: '',
        items: [{ product_name: '', product_type: 'Digital Software', quantity: 1, unit_price: '' }],
        transaction_date: new Date().toISOString().split('T')[0]
      });
      setResults(null);
    } catch (err) {
      setError('Failed to save transaction');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="tax-calculator-container">
      <div className="tax-calculator">
        <h1>Tax Calculator</h1>

        {error && <div className="alert alert-danger">{error}</div>}
        {successMessage && <div className="alert alert-success">{successMessage}</div>}

        <form onSubmit={handleSubmit}>
          <div className="form-section">
            <h2>Customer Information</h2>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="customer_name">Customer Name *</label>
                <input
                  type="text"
                  id="customer_name"
                  name="customer_name"
                  value={formData.customer_name}
                  onChange={handleInputChange}
                  className="form-control"
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="customer_email">Customer Email</label>
                <input
                  type="email"
                  id="customer_email"
                  name="customer_email"
                  value={formData.customer_email}
                  onChange={handleInputChange}
                  className="form-control"
                />
              </div>
            </div>

            <div className="form-row">
              <div className="form-group">
                <label htmlFor="jurisdiction_id">Jurisdiction *</label>
                <select
                  id="jurisdiction_id"
                  name="jurisdiction_id"
                  value={formData.jurisdiction_id}
                  onChange={handleInputChange}
                  className="form-control"
                  required
                >
                  <option value="">Select a jurisdiction</option>
                  {jurisdictions.map(jurisdiction => (
                    <option key={jurisdiction.id} value={jurisdiction.id}>
                      {jurisdiction.name} ({jurisdiction.country} - {jurisdiction.state_province || 'N/A'})
                    </option>
                  ))}
                </select>
              </div>

              <div className="form-group">
                <label htmlFor="transaction_date">Transaction Date</label>
                <input
                  type="date"
                  id="transaction_date"
                  name="transaction_date"
                  value={formData.transaction_date}
                  onChange={handleInputChange}
                  className="form-control"
                />
              </div>
            </div>
          </div>

          <div className="form-section">
            <h2>Products</h2>
            {formData.items.map((item, index) => (
              <div key={index} className="product-item">
                <div className="product-header">
                  <h3>Product {index + 1}</h3>
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label htmlFor={`product_name_${index}`}>Product Name *</label>
                    <input
                      type="text"
                      id={`product_name_${index}`}
                      name="product_name"
                      value={item.product_name}
                      onChange={(e) => handleItemChange(index, e)}
                      className="form-control"
                      required
                    />
                  </div>

                  <div className="form-group">
                    <label htmlFor={`product_type_${index}`}>Product Type *</label>
                    <select
                      id={`product_type_${index}`}
                      name="product_type"
                      value={item.product_type}
                      onChange={(e) => handleItemChange(index, e)}
                      className="form-control"
                      required
                    >
                      <option value="Digital Software">Digital Software</option>
                      <option value="E-book">E-book</option>
                      <option value="Digital Media">Digital Media</option>
                      <option value="Online Service">Online Service</option>
                    </select>
                  </div>
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label htmlFor={`quantity_${index}`}>Quantity *</label>
                    <input
                      type="number"
                      id={`quantity_${index}`}
                      name="quantity"
                      value={item.quantity}
                      onChange={(e) => handleItemChange(index, e)}
                      className="form-control"
                      min="1"
                      required
                    />
                  </div>

                  <div className="form-group">
                    <label htmlFor={`unit_price_${index}`}>Unit Price ($) *</label>
                    <input
                      type="number"
                      id={`unit_price_${index}`}
                      name="unit_price"
                      value={item.unit_price}
                      onChange={(e) => handleItemChange(index, e)}
                      className="form-control"
                      step="0.01"
                      min="0.01"
                      required
                    />
                  </div>
                </div>

                {formData.items.length > 1 && (
                  <div className="remove-item-container">
                    <button
                      type="button"
                      className="btn btn-outline-danger btn-sm"
                      onClick={() => removeItem(index)}
                    >
                      Remove Product
                    </button>
                  </div>
                )}
              </div>
            ))}

            <div className="add-item-container">
              <button
                type="button"
                className="btn btn-outline-primary"
                onClick={addItem}
              >
                Add Another Product
              </button>
            </div>
          </div>

          <div className="form-actions">
            <button
              type="submit"
              className="btn btn-primary"
              disabled={loading}
            >
              {loading ? 'Calculating...' : 'Calculate Tax'}
            </button>
          </div>
        </form>

        {results && (
          <div className="results-section">
            <h2>Tax Calculation Results</h2>

            <div className="results-summary">
              <div className="result-item">
                <div className="result-label">Subtotal:</div>
                <div className="result-value">${parseFloat(results.subtotal).toFixed(2)}</div>
              </div>
              <div className="result-item">
                <div className="result-label">Tax Amount:</div>
                <div className="result-value">${parseFloat(results.tax_amount).toFixed(2)}</div>
              </div>
              <div className="result-item total">
                <div className="result-label">Total:</div>
                <div className="result-value">${parseFloat(results.total_amount).toFixed(2)}</div>
              </div>
            </div>

            <div className="tax-breakdown">
              <h3>Tax Breakdown</h3>
              <table className="tax-breakdown-table">
                <thead>
                  <tr>
                    <th>Tax Type</th>
                    <th>Rate</th>
                    <th>Amount</th>
                  </tr>
                </thead>
                <tbody>
                  {results.tax_breakdown.map((item, index) => (
                    <tr key={index}>
                      <td>{item.tax_type}</td>
                      <td>{(parseFloat(item.rate) * 100).toFixed(2)}%</td>
                      <td>${parseFloat(item.amount).toFixed(2)}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>

            <div className="save-transaction">
              <button
                className="btn btn-success"
                onClick={handleSaveTransaction}
                disabled={loading}
              >
                {loading ? 'Saving...' : 'Save Transaction'}
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default TaxCalculator;
